import { Typography,Box,Button,Card,CardMedia,CardContent,CardCon } from "@material-ui/core";

const PlaceDetails=({place}) =>{
    
    return (
        <div>
            <h1>
                {place.name}
            </h1>
        </div>
    )
}

export default PlaceDetails;
